import Tippy from '@tippyjs/react';

interface Props {
  children: any;
  selected: boolean;
}

function Selected(props: Props) {
  const { children, selected } = props;
  return (
    <Tippy
      interactive
      placement="bottom-end"
      render={(attrs) => (
        <div style={{ background: '#000' }} tabIndex={1} {...attrs}>
          <h2>asdasd</h2>
          <h2>asdasds</h2>
        </div>
      )}
    >
      {children}
    </Tippy>
  );
}

export default Selected;
